import React from "react";

const Header = () => {
  return (
    <header>
      <h1>Fisher Random Chess</h1>
      <nav>
        <ul>
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="/about">About</a>
          </li>
          <li>
            <a href="/rules">Rules</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
